import React from 'react';
import './Input.css';


function Input() {
    return (
        <form id="Input"> 
            <input type="text" placeholder="Notation..." value={this.props.notation} onChange={this.props.updateNotation} />
            <input type="submit" value="Add" onClick={this.props.addNotation} />
        </form>
    );
}

export default Input;
